import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input by ID
    await page.waitForSelector('#searchInput', { timeout: 5000 });

    // Attempt XSS payload in the search input
    const xssPayload = `"><img src=x onerror=alert('XSS')>`;
    await page.fill('#searchInput', xssPayload);

    // Take screenshot after filling the payload
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_xss_payload_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_xss_payload_filled.png'));

    // Wait for the search button (by class, first occurrence)
    await page.waitForSelector('.search-btn', { timeout: 5000 });

    // Click the search button
    const searchBtn = await page.$('.search-btn');
    if (searchBtn) {
      await searchBtn.click();
    }

    // Wait for search results or any visible change (look for "Search Results" heading)
    await page.waitForSelector('text=Search Results', { timeout: 5000 });

    // Take screenshot after search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_search.png'));

    // Extract any HTML in the search results area that might reflect the input
    let reflected = '';
    try {
      const el = await page.$('h2:has-text("Search Results")');
      if (el) {
        reflected = await el.textContent();
      }
    } catch {}

    // Also try to extract the innerHTML of the main content area
    let mainContentHTML = '';
    try {
      const mainContent = await page.$('#mainContent');
      if (mainContent) {
        mainContentHTML = await mainContent.innerHTML();
      }
    } catch {}

    return {
      success: true,
      action: "Attempted XSS via Search Input and captured search results for reflection or execution evidence",
      extractedData: {
        reflectedHeading: reflected,
        mainContentHTML: mainContentHTML
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
